Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty of Counts 3 and 4 as charged in the Amended Information and ordered a Judgment of Conviction be entered into the record.    Sentencing proceeded.  Statements by the State, defense and defendant. The Court imposed the following:

AS TO COUNT 03:
The Court sentenced the defendant to serve 6 months at the House of Correction, with Huber for work if employed, release to Day Reporting Center, and good time; credit for 4 days time served.  The Court STAYED said sentence and placed defendant on probation for 24 months.
 * Court ordered defendant to provide a DNA sample.

AS TO COUNT 04:
The Court imposed 6 months at the House of Correction, with Huber for work if employed, release to the Day Reporting Center, and good time, consecutive to Count 3.  Court STAYED said sentence and placed defendant on probation for two (2) years concurrent to Count 3.
 * DNA sample ordered in Count 3.

 CONDITIONS OF PROBATION FOR COUNTS 3 AND 4:
 - No contact with Lori P., her residence,  Todd J. or his residence;
 - No controlled substances or alcohol;
 - Urine screens to ensure compliance;
 - AODA assessment; treatment if needed;
 - No contact with co-defendant Shawn Muszytowski;
 - Obtain high school diploma, HSED or GED;
 - Perform 75 hours of community service;
 - Full time work and/or combination of work and school full-time;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay restitution in the stipulated amount of $56.61 to Lori P.,  joint and several with co-defendant in 15CF2090; pay the DNA surcharges, plus costs and disbursements.  Failure to pay amounts in full by the end of the probationary period would result in a civil judgment entered against defendant which is non-dischargable in bankruptcy.  

Should defendant complete all conditions set by this court and by the Probation Department; and if defendant pays all court costs and surchargess as ordered  and remains free and clear of the criminal justice system arising to the level of probable cause, the Court would consider petition for expungement.

